import React from 'react';
import backgroundImage from './result.png'; // Adjust path as necessary

function Header() {
  return (
    <header 
      className="bg-cover bg-no-repeat bg-center min-h-screen text-white relative" 
      style={{ backgroundImage: `url(${backgroundImage})` }}>

      <div className="container mx-auto px-6 md:px-12 lg:px-24 h-full flex flex-col justify-between">
        {/* Top header area */}
        <div className="pt-4">
          <h1 className="text-4xl font-bold">Welcome to Our Site</h1>
        </div>

        {/* Primary Navigation in the center */}
        <nav className="flex justify-center">
          <div className="flex items-center space-x-6">
            <a href="#about" className="text-lg font-medium hover:text-gray-300">About</a>
            <a href="#features" className="text-lg font-medium hover:text-gray-300">Features</a>
            {/* Additional primary navigation links can go here */}
          </div>
        </nav>

        {/* Bottom header area with CTA */}
        <div className="pb-4 text-center">
          <p className="text-xl md:text-3xl mb-4 max-w-xl mx-auto">Discover the amazing world of Tailwind CSS</p>
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Get Started
          </button>
        </div>
      </div>
    </header>
  );
}

export default Header;
